	/// <summary>
	/// Database connections' management class for testing purposes.
	/// </summary>
	public static class DB
	{
		/// <summary>
		/// Creates a new link associated with the test database.
		/// </summary>
		/// <returns></returns>
		public static Direct.IDataLink Create()
		{
			var link = Direct.DataLink.Create();
			return link;
		}

		/// <summary>
		/// Gets a valid shared data link.
		/// </summary>
		public static Direct.IDataLink Link
		{
			get
			{
				if (_Link == null || _Link.IsDisposed) _Link = Create();
				return _Link;
			}
		}
		static Direct.IDataLink _Link = null;

		/// <summary>
		/// Whether the test database can be considered as prepared for testing purposes.
		/// </summary>
		public static bool IsPrepared
		{
			get { return _IsPrepared; }
			set { _IsPrepared = value; }
		}
		static bool _IsPrepared = false;

		/// <summary>
		/// Deletes all the contents from the database.
		/// </summary>
		public static void DeleteContents()
		{
			Link.Raw("DELETE FROM EmployeeTalents").Execute();
			Link.Raw("DELETE FROM Talents").Execute();
			Link.Raw("DELETE FROM Employees").Execute();
			Link.Raw("DELETE FROM Countries").Execute();
			Link.Raw("DELETE FROM Regions").Execute();

			_IsPrepared = false;
		}

		/// <summary>
		/// Recreates, if needed, the contents of the underlying database for testing purposes.
		/// </summary>
		public static void Prepare(bool forced = false, bool restricted = true)
		{
			if (forced) _IsPrepared = false;
			if (_IsPrepared) return;

			ConsoleEx.WriteLine();
			ConsoleEx.WriteLine("- Deleting DB contents...");
			DeleteContents();

			_IsPrepared = true;
			ConsoleEx.WriteLine("- Creating DB contents...");

			ResetRegionsList(restricted); foreach (var item in Regions)
			{
				Link.Insert(x => x.Regions)
					.Columns(
						x => x.Id = item.Id,
						x => x.Name = item.Name,
						x => x.ParentId = item.ParentId)
					.Execute();
			}
			ResetCountriesList(restricted); foreach (var item in Countries)
			{
				Link.Insert(x => x.Countries)
					.Columns(
						x => x.Id = item.Id,
						x => x.Name = item.Name,
						x => x.RegionId = item.RegionId)
					.Execute();
			}
			ResetEmployeesList(restricted); foreach (var item in Employees)
			{
				Link.Insert(x => x.Employees)
					.Columns(
						x => x.Id = item.Id,
						x => x.FirstName = item.FirstName,
						x => x.LastName = item.LastName,
						x => x.BirthDate = item.BirthDate,
						x => x.ManagerId = item.ManagerId,
						x => x.CountryId = item.CountryId,
						x => x.JoinDate = item.JoinDate,
						x => x.StartTime = item.StartTime,
						x => x.Active = item.Active)
					.Execute();
			}
			ResetTalentsList(restricted); foreach (var item in Talents)
			{
				Link.Insert(x => x.Talents)
					.Columns(
						x => x.Id = item.Id,
						x => x.Description = item.Description)
					.Execute();
			}
			ResetEmployeeTalentsList(restricted); foreach (var item in EmployeeTalents)
			{
				Link.Insert(x => x.EmployeeTalents)
					.Columns(
						x => x.EmployeeId = item.EmployeeId,
						x => x.TalentId = item.TalentId)
					.Execute();
			}
		}

